    <script>
        const openModalButton = document.getElementById('openModal');
        const closeModalButton = document.getElementById('closeModal');
        const modal = document.getElementById('myModal');

        openModalButton.addEventListener('click', () => {
            modal.style.display = 'block';
            setTimeout(() => {
                modal.style.opacity = '1';
                modal.querySelector('.modal-content').style.transform = 'translateY(0)';
            }, 10);
        });

        closeModalButton.addEventListener('click', () => {
            modal.style.opacity = '0';
            modal.querySelector('.modal-content').style.transform = 'translateY(100%)';
            setTimeout(() => {
                modal.style.display = 'none';
            }, 300);
        });


        //success message toasr
        $(document).ready(function() {
            var dataSuccess = document.getElementById('datasuccess').innerHTML;
            displaySuccessMessage(dataSuccess);
        });
        $(document).ready(function() {
            var success = document.getElementById('success').innerHTML;
            displaySuccessMessage(success);
        });

        function displaySuccessMessage(message) {
            toastr.success(message, 'Success', {
                timeOut: 3000
            });
        }
    </script>

